INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (0, 102601, "リン", "あたしだって\nやるときはやるよ！", 0.0, 24001, 0.0, 0.0, 1, 1, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (1, 102601, "リン", "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 24002, 0.0, 0.0, 1, 1, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (2, 102601, "リン", "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 24003, 0.0, 0.0, 1, 1, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (3, 102601, "リン", "やったね！\nこれでようやく\nサボれるよ…", 0.0, 24004, 0.0, 0.0, 2, 2, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (4, 102601, "リン", "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 24005, 0.0, 0.0, 1, 1, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (5, 102601, "リン", "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 24006, 0.0, 0.0, 2, 2, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (6, 102601, "リン", "あたしも意外と\nやるもんでしょ？", 0.0, 24007, 0.0, 0.0, 2, 2, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (7, 102601, "リン", "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 24008, 0.0, 0.0, 4, 4, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (8, 102601, "リン", "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 24009, 0.0, 0.0, 4, 4, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (9, 102601, "リン", "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 24010, 0.0, 0.0, 4, 4, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (10, 102601, "リン", "やられた…\nねずみって意外と\nてごわいね", 0.0, 24011, 0.0, 0.0, 4, 4, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (11, 102601, "リン", "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 24012, 0.0, 0.0, 4, 4, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
INSERT INTO `v1_449d734fc18bdfefe680abe16553c80e1c42be1545df2796ca2925c107746e76` VALUES (12, 102601, "リン", "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, 24013, 1.81, 0.0, 1, 4, 24, 10040, "2020/04/30 12:00:00", "2030/12/17 14:59:59");
